import{_ as t,c as e,o as a,a as o}from"./app.b80f3151.js";const g=JSON.parse('{"title":"Getting Started","description":"","frontmatter":{},"headers":[{"level":2,"title":"\u{1F469}\u200D\u{1F4BB} First, account!","slug":"woman-technologist-first-account"},{"level":2,"title":"\u{1F3E2} Organisation","slug":"\u{1F3E2}-organisation"},{"level":2,"title":"\u{1F468}\u{1F3FB}\u200D\u{1F4BC} Roles","slug":"\u{1F468}\u{1F3FB}\u200D\u{1F4BC}-roles"},{"level":2,"title":"\u{1F4F6} SIMs","slug":"\u{1F4F6}-sims"},{"level":2,"title":"\u{1F48C} SMS","slug":"\u{1F48C}-sms"},{"level":2,"title":"\u{1F4CA} CDR","slug":"\u{1F4CA}-cdr"}],"relativePath":"guide/gettingstarted.md","lastUpdated":1665711432000}'),s={name:"guide/gettingstarted.md"},i=o('<h1 id="getting-started" tabindex="-1">Getting Started <a class="header-anchor" href="#getting-started" aria-hidden="true">#</a></h1><div class="info custom-block"><p class="custom-block-title">Cubers</p><p>Welcome to join us! \u{1F389}</p></div><h2 id="woman-technologist-first-account" tabindex="-1">\u{1F469}\u200D\u{1F4BB} First, account! <a class="header-anchor" href="#woman-technologist-first-account" aria-hidden="true">#</a></h2><ul><li><p>If you already have an account (email, password) with Cube, sign in <a href="https://beta.iotcube.link" target="_blank" rel="noopener noreferrer">here</a>.</p></li><li><p>Else check <a href="./getaccount.html">here</a> for information on getting a new account.</p></li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Additionally, when you already have an account, but you have forgotten the password, simply choose \u201Cforget password\u201D on the sign-in page to reset your password.</p></div><h2 id="\u{1F3E2}-organisation" tabindex="-1">\u{1F3E2} Organisation <a class="header-anchor" href="#\u{1F3E2}-organisation" aria-hidden="true">#</a></h2><p>When you sign in, Cube will sign you in with your default organisation (if not appointed, the first organisation you have joined).</p><p>One account (uniquely identified by email) can have roles with multiple organizations.</p><div class="info custom-block"><p class="custom-block-title">Create Organization</p><p>Admin and above roles can <a href="./organisation.html">create organisation</a>.</p></div><h2 id="\u{1F468}\u{1F3FB}\u200D\u{1F4BC}-roles" tabindex="-1">\u{1F468}\u{1F3FB}\u200D\u{1F4BC} Roles <a class="header-anchor" href="#\u{1F468}\u{1F3FB}\u200D\u{1F4BC}-roles" aria-hidden="true">#</a></h2><p>There are following roles:</p><table><thead><tr><th>Roles</th><th style="text-align:center;">Description</th></tr></thead><tbody><tr><td><strong><code>superadmin</code></strong></td><td style="text-align:center;">One per organization, full access</td></tr><tr><td><strong><code>admin</code></strong></td><td style="text-align:center;">administrators and operational access</td></tr><tr><td><strong><code>operator</code></strong></td><td style="text-align:center;">operational access</td></tr><tr><td><strong><code>user</code></strong></td><td style="text-align:center;">read-only access</td></tr></tbody></table><div class="info custom-block"><p class="custom-block-title">Roles</p><p>Click <a href="./roles.html">here</a> for information in <strong>permissions and roles</strong>.</p></div><h2 id="\u{1F4F6}-sims" tabindex="-1">\u{1F4F6} SIMs <a class="header-anchor" href="#\u{1F4F6}-sims" aria-hidden="true">#</a></h2><p>After you sign-in, you will be able to see all the SIMs your oganization currently owns.</p><p>Depending on which role you have with the organization, you will have permission to access the SIMs accordingly.</p><p>SIM has its own life cycle status, in which SIM exhibits different behaviours.</p><div class="info custom-block"><p class="custom-block-title">SIM Status</p><p>Click <a href="./simstatus.html">here</a> for more information.</p></div><div class="info custom-block"><p class="custom-block-title">Order SIMs</p><p>Click <a href="./order.html">here</a> to checkout SIM ordering.</p></div><div class="info custom-block"><p class="custom-block-title">SIM operations</p><p>Click <a href="./checksim.html">here</a> to find out more about the SIM operations.</p></div><h2 id="\u{1F48C}-sms" tabindex="-1">\u{1F48C} SMS <a class="header-anchor" href="#\u{1F48C}-sms" aria-hidden="true">#</a></h2><p>Cube offers a way to send SMS to SIMs, either individually or in bulk.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Do note that not all SIMs support this feature. The greyed button suggests &#39;not supported&#39;.</p></div><div class="info custom-block"><p class="custom-block-title">SMS</p><p>Check <a href="./sms.html">here</a> to learn how to send SMS from Cube.</p></div><h2 id="\u{1F4CA}-cdr" tabindex="-1">\u{1F4CA} CDR <a class="header-anchor" href="#\u{1F4CA}-cdr" aria-hidden="true">#</a></h2><p>We generate a standard CDR (Call Detail Record) on each data/call session or SMS. But there is usually latency between the actual session and the data synchronization.</p><div class="tip custom-block"><p class="custom-block-title">Latency</p><p>Latency varies from operator to operator, more commonly, it is between 10 minutes to 24 hours.</p></div><p>Cube provides CDR records for each SIM, detailing session duration, type, direction of data link, volume, country, MNO and so on, which can be traced back to 3 months ago. For CDR that is more than 3 months old will be archived and can be</p><div class="info custom-block"><p class="custom-block-title">CDR query</p><p>For more details, click <a href="./cdr.html">here</a></p></div>',29),r=[i];function n(l,c,d,h,p,u){return a(),e("div",null,r)}var f=t(s,[["render",n]]);export{g as __pageData,f as default};
